import{_ as e,c as a,o as t,a1 as o}from"./chunks/framework.CSTfz1pA.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"honeycomb/dex.md","filePath":"honeycomb/dex.md"}'),i={name:"honeycomb/dex.md"},n=o('<p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23t773MmCnX4nuFqfBHmTseKcAvfqpJbE34JVMFUNttTyJShBe3vBPSjDrPbD1gT54vEU.png" alt="A HoneyComb DEX "></p><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tGTm22JV3aTi9wMgkpW3KrnUiL16U8JCyMdLx7TXcnjBrDVrjKt6EPRU9kBtJEMYMGx.png" alt="First 12 Days"></p><h4 id="claims" tabindex="-1">Claims: <a class="header-anchor" href="#claims" aria-label="Permalink to &quot;Claims:&quot;">​</a></h4><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tGTkuZy4oXh1gny2vJhxB34UD1HB8yijZpTSUK1HbTjSNmJ7tXX37DAwsU8KKbuLsAo.png" alt="SPK Airdrops"></p><p>If you are logged in with an account with available claims you can click the Claim button and nab them via Hive KeyChain.</p><h2 id="dex" tabindex="-1">DEX <a class="header-anchor" href="#dex" aria-label="Permalink to &quot;DEX&quot;">​</a></h2><h4 id="market-overview-and-chart" tabindex="-1">Market Overview and Chart <a class="header-anchor" href="#market-overview-and-chart" aria-label="Permalink to &quot;Market Overview and Chart&quot;">​</a></h4><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tGTqrFpfXHKpDfETrpenwdw1kRAZLEienYk754LuvNQTMLYHF7GE62g87uR5q2sLTXC.png" alt="Current Information"> Click the HIVE or HBD Market Selector to see current conditions of that DEX. The &#39;6h&#39; dropdown menu will select bar widths on the chart from 1 minute to 1 day. The Bid/Ask/Last/24 hour volume is only for the Hive or HBD market as selected. The Token price is also calculated based on this last quote in the selected market.</p><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tGTqrvPyUXfXphHhnKtWQP65iKF1ti4rqrDeChSSoUvQC3LzDSomi1KAruuqm914p5v.png" alt="More Information"> The Token Supply, Market Cap (Based on the Hive or HBD last price), DEX Fee (set by node operators), and the estimated clearing time of Hive Transactions in the multi-sig wallet are here. 10 minutes is expected because the DEX has to sign, and pass around signatures, then collect and verify those signature, then broadcast the transactions. Canceling Orders, and getting paid for your token sales both take about this long.</p><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tkdkb6QDbv2suDub6rDDKFd22R3XZQNwWMj54axiWyfBvX2YtE8Hm9o5RGHsGXh9Yez.png" alt="Open Orders"> If you have any open orders you&#39;ll be able to see the status in this menu, as well as cancel these orders. The Token / Hive or HBD balance shown are remaining to be filled and will only be the original values if it&#39;s 0% filled.</p><h4 id="send-tokens" tabindex="-1">Send Tokens <a class="header-anchor" href="#send-tokens" aria-label="Permalink to &quot;Send Tokens&quot;">​</a></h4><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tvAiuQzDXVEWwSFoiMV4u8AkTAYBoq1S7aYUDKufMXh7PWejoHVJAjMt9WyGznWsUue.png" alt="Send Tokens"></p><p>Clicking your liquid balance will bring up a send form. Consolidate or send your tokens to your node account.</p><h4 id="power-menu" tabindex="-1">Power Menu <a class="header-anchor" href="#power-menu" aria-label="Permalink to &quot;Power Menu&quot;">​</a></h4><p>DLUX has a Proof of Brain System and you&#39;ll be able to interact with the Power System of HoneyComb Tokens with this menu.</p><h4 id="gov-menus" tabindex="-1">Gov Menus <a class="header-anchor" href="#gov-menus" aria-label="Permalink to &quot;Gov Menus&quot;">​</a></h4><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23tGXnKw7YqLB9ZC8omtPNnHpT3gAX9C686RdPYRnyqesiJduojeacvPj9oVGW4BqUMpy.png" alt="Lock / Unlock Menu"></p><p>If you&#39;ve set up a HoneyComb node on this account you&#39;ll see a couple of additional items. A Gov balance form with lock and unlock options. This form displays the current &quot;Runner&quot; threshold.</p><p><img src="https://files.peakd.com/file/peakd-hive/disregardfiat/23t74ySxJuTkMy63RGgdcb4Q8BUCTYM63XKhJpp8acqLjo74y7QczGLVN123GHSukPRky.png" alt="Gov Options"></p><p>Additionally, the claim menu will have your shares, and the settings menu will have some API driven menus to set the node options defined by the community.</p>',20),s=[n];function r(d,l,h,p,c,u){return t(),a("div",null,s)}const k=e(i,[["render",r]]);export{f as __pageData,k as default};
